import React, { Fragment, useState } from "react";

import Footer from "./components/footer";
import Header from "./components/header";
function App() {
  // Crear listado de productos
  const [productos, guardarProductos] = useState([
    {id: 1, nombre: 'Camisa ReactJS', precio:50},
    {id: 2, nombre: 'Camisa ReactJS', precio:50},
    {id: 3, nombre: 'Camisa ReactJS', precio:50},
    {id: 4, nombre: 'Camisa Node', precio:50},
  ]);
  // Obtener la fecha

  const fecha = new Date().getFullYear();

  return (
    <Fragment>
      <Header titulo="Tienda Virtual"></Header>

      <p>Esta es mi primera pagina web con REACT.js</p>

      <Footer fecha={fecha}></Footer>
    </Fragment>
  );
}

export default App;
